      $scope.checked = function(val) {
        console.log(val)
        if(val.value == 'all') {
          $scope.locations = $scope.original_locations
        }
        else {
          $scope.locations = _.filter($scope.original_locations, function(i){ return i.Location== val.value; });
        }
      }


